Validator.ClientEvent:
if (arg.entity.get("tbsBasIdcardtype")) {
	debugger;
	// get card type
	var cardtypeId = arg.entity.get("tbsBasIdcardtype").get("id");
	var idcardnum = arg.entity.get("idcardnum");
	var now = new Date();
	var yearNow = now.getFullYear();
	// define 15bit & 18bit rgExp
	rgExp15 = /^[1-9]\d{7}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{3}$/;
	//rgExp18 = /^[1-9]\d{5}[1-9]\d{3}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{4}$/;
	rgExp18 = /^[1-9][0-9]{5}(19[0-9]{2}|200[0-9]|2010)(0[1-9]|1[0-2])(0[1-9]|[12][0-9]|3[01])[0-9]{3}([0-9]|[X]|[x])$/;
	if(cardtypeId==1){
		if (idcardnum.match(rgExp15)){
			arg.entity.set("age",yearNow - 1900 - idcardnum.substring(6,8));
		} else if (idcardnum.match(rgExp18)){
			arg.entity.set("age",yearNow - idcardnum.substring(6,10));
		} else {
			throw new dorado.Exception("请输入合法的身份证号码！！");
		}
		
	}
}

